} In order to run a simulation we need to create a run manager: auto run_manager = n4::run_manager::create() The run manager needs to be initialized with 3 attributes: A physics list A geometry A set of actions To build the action set we need to provide a primary generator action. Other actions are optional. Note that the physics list must be instantiated and given to the run manager before the primary generator is instantiated. We provide the run manager with these attributes: // Important! physics list has to be set before the generator! .physics<FTFP_BERT>(0) // version 0 .geometry(my_geometry) .actions(create_actions(n_event)); here, my_geometry, and my_generator are the two functions we need to provide to run our simulation: auto my_geometry() { auto water = n4::material("G4_WATER"); auto air = n4::material("G4_AIR"); auto steel = n4::material("G4_STAINLESS-STEEL"); auto world = n4::box("world").cube(2*m).x(3*m).volume(water); n4::sphere("bubble").r(0.2*m) .place(air).in(world).at(1.3*m, 0.8*m, 0.3*m).now(); n4::tubs ("straw" ).r(0.1*m).z(1.9*m).place(air).in(world).at(0.2*m, 0 , 0 ).now(); G4RotationMatrix rot; rot.rotateX(-90 * deg); // TODO replace RotationMatrix with place.rotate_x() n4 ::sphere("socket-cap" ).r(0.3*m).phi_delta(180*deg) .sub(n4::box ("socket-hole").cube(0.4*m)) .name("socket") .place(steel).in(world).rotate(rot).at(1*m, 0, 0.7*m).now(); return n4::place(world).now();
