The auxiliary placement methods belong to an object of type n4::place. Instances of this type can accumulate state. This can be useful for reducing repetition: compare the following two code samples, which produce identical results // Store complicated configuration
auto place_box = n4::box("box").cube(1*m).place(gold).in(world).at_x(1*m);
// Reuse it many times, emphasizing what differs: rot_z(angle) and copy_no(N)
place_box.clone().rot_z(23*deg).copy_no(1).now();
place_box.clone().rot_z(54*deg).copy_no(2).now();
place_box.clone().rot_z(91*deg).copy_no(3).now(); // Repeat complicated configuration explicitly: signal lost in the noise n4::box("box").cube(1*m).place(gold).in(world).at_x(1*m).copy_no(1).rot_z(23*deg).now();
n4::box("box").cube(1*m).place(gold).in(world).at_x(1*m).copy_no(2).rot_z(54*deg).now();
n4::box("box").cube(1*m).place(gold).in(world).at_x(1*m).copy_no(3).rot_z(91*deg).now(); However, note the presence of .clone() on each line of the first sample. Without it, the effect of each call to rot_z would be accumulated in place_box place_box = n4::box("box").cube(1*m).place(copper).in(world); // Place boxes at 1, 2 and 3 metres
