nain4 provides a collection of methods to create boolean solids described in n4 boolean solids . These functions accept either a n4::shape or G4VSolid*. However, when building a geometry, it's fairly easy to get confused with the different stages of the creation of components (solid, (logical)volume, place(ment)). This can produce errors that might be difficult to understand. nain4 attempts to clarify them by providing explicit compile-time messages for the most likely cases. Here we describe all these errors and try to give a through explanation of their causes and how to handle them. For this explanation we will use the addition of two boxes as an example, but the rationale does not depend on the shapes or the methods used. Here is the definition of the boxes: n4::box box1 = n4::box("box1").cube(1*m);
n4::box box2 = n4::box("box2").cube(2*m);
G4Box* box3 = new G4Box{"box3", 3*m, 3*m, 3*m};

