The variable passed to the boolean-creation method is of type G4LogicalVolume*. The most likely causes are: [G4-style] this variable was bound to a new G4LogicalVolume(...), e.g. G4Box* box2_solid = new G4Box(...);
G4LogicalVolume* box2_logic = new G4LogicalVolume(box2_solid, ...);
box1.add(box2_logic); // WRONG The solution is to pass box2_solid instead of box2_logic. [n4-style] you called .volume(...) on the input solid, e.g. box1.add(box2.volume(...)); // WRONG The solution is to remove the call to volume(...) or call .solid() instead.

