box1.add(box2_place); // WRONG The solution is to pass box2_solid instead of box2_place. [n4-style] you called .place(...).other().methods().now() on the input solid, e.g. box1.add(box2.place(...).other().methods().now()); // WRONG The solution is to remove the call to place(...).other().methods().now() or call .solid() instead.

